```rust
use reqwest::Client;
use serde::{Deserialize, Serialize};

#[derive(Serialize, Deserialize, Debug)]
struct ElevenLabsResponse {
    text: String,
}

struct ElevenLabsClient {
    client: Client,
    api_key: String,
}

impl ElevenLabsClient {
    fn new(api_key: String) -> Self {
        Self {
            client: Client::new(),
            api_key,
        }
    }

    async fn generate_text(&self, prompt: &str) -> Result<String, reqwest::Error> {
        let url = "https://api.eleven-labs.com/v1/text";
        let body = serde_json::json!({
            "prompt": prompt,
        });

        let response = self
            .client
            .post(url)
            .header("Authorization", format!("Bearer {}", self.api_key))
            .json(&body)
            .send()
            .await?;

        let response_body = response.text().await?;
        let response: ElevenLabsResponse = serde_json::from_str(&response_body)?;

        Ok(response.text)
    }
}
```
